INSERT INTO `t_miner` VALUES ('3', '59800', '500', '矿机规格参数：</br>\n额定算力	ETH 230MH/s ±5％ ZEC 2050H/s XMR 5520H/S</br>\n墙上功耗	ETH 1250瓦+10% ZEC 1025瓦+10% XMR 980瓦+10%</br>\n电源效率	1600瓦电源， 效率约93％，25℃环境温度</br>\n额定电压	220 V</br>\n显卡数量	 AMD RX 474*8张</br>\n显存	4 G</br>\n外形尺寸	490毫米（L）*280毫米（W）*170毫米（H）</br>\n毛重	14.7 KG</br>\n净重	13 KG</br>\n冷却	3*2风扇</br>\n噪音	80 dB</br>\n工作温度	0℃至40℃</br>\n工作湿度	5%RH-95%RH，非凝露</br>\n网络连接	以太网</br>\n电源连接方式	每台显卡矿机7个6pin口都需要连接，推荐使用独立电源给整机供电</br>\nCPU	Inter(R) Celeron(R) CPU 3215U @1.70 GHZ</br>\n内存	4GB</br>\n系统类型	64位操作系统，基于x64的处理器</br>\n系统	Windows 10</br>', '小矿主(5台)', 'http://39.98.58.74:8081/upload/2018-11-07/1541562595937.jpg', '15000', '120', '0.08', '0.08', '0.05', '5');
