INSERT INTO `t_miner` VALUES ('207', '6800', '50', '1.额定算力：14.5TH/s±5％</br>\n2.墙上功耗：1365W+10%（墙上，AC/DC 93％的效率，25°C的环境温度）</br>\n3.电源效率：94.14J/TH+10%（墙上，AC/DC 93％的效率，25°C的环境温度）</br>\n4.额定电压：11.6~13.0V</br>\n5.外箱尺寸：445毫米（L）*215毫米（W）*255毫米（H）</br>\n6.冷却：2×12038风扇</br>\n7.工作温度：0℃至40℃</br>\n8.工作湿度：5%RH-95%RH，非凝露</br>\n9.网络连接：以太网</br>\n10.噪音：76dB</br>\n11.整机重量：矿机5.5kg+电源2.5kg</br>', '算力T1矿机', 'http://39.98.58.74:8081/upload/2018-11-07/1541562561734.jpg', '1500', '142', '0.05', '0', '0.02', '1');
INSERT INTO `t_notice` VALUES ('30192', '2018-11-15 18:41:00', '<p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">双十一的神话再次刷屏，但今年破纪录的数据背后又隐藏着另外一些新生力量的萌芽，未来的双十一会是什么样子呢？</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">全球独一档的中国电商</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">昨天，朋友圈里多了这两拨人，一边大喊“断网保平安”，另一边高呼“剁手大法好”，当然，价格敏感型消费者（穷人）的数量取得了压倒胜利，嘴上说不要，双手还是很实诚，从早到晚，土豪们根本没停止过晒单行为。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">截止至11月12日零点，双十一的开创者天猫当日的销售额揭晓：好家伙，2135亿！整整比一年前增长了四百多亿。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">就这还消费降级呢？说好的一起到白头，你却偷偷焗了油。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/1316390_image3.png\" alt=\"jwcIuZ8qeESwE2AOVLkTZMIiAVk0VBrkAokrXD1T.jpeg\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">乍一看，数据很爆炸，形势也很喜人，然而，不得不提的是，今年不光是天猫第十个的双十一，也是马爸爸卸任阿里董事长前的最后一个双十一。没有了马云的阿里会否像后乔布斯时代的苹果一样，迎来阵痛期吗？关于这个问题，现在恐怕还没有人敢一口咬定。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">但可以肯定，在搞电商促销方面，能够打败天猫的人还没有出现。不光是国内“猫狗狮”的其余两家，就算放眼全球，2135亿这个数字，也已经变成了一个不可跨越的鸿沟。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">天猫说，你们一起上吧，我赶时间。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">举一个例子，零点过后的短短10分钟内，天猫成交额就已经超过了美国最成功的购物节——由亚马逊在今年山寨双十一而来的Prime Day，它在36个小时的销售总和是42亿美元。没错，这根本不是一个量级的比拼。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">事实上，不光是亚马逊，即使是整个北美的黑五，在双十一面前，也只不过是一个“弟弟”。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">这是所有人都无法预料的，在2009年，饱受假货风波下成立的淘宝商城，步步为营，发展缓慢，在那场中国电商的大乱斗中，双十一的初衷很单纯，就是为了让淘宝活下去。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">甚至于有这样的一个小插曲：第一个双十一GMV达到5000万元，打算拍照留念的淘宝员工，发现少了一张“0”，便一把将墙上的挂钟拿下来凑够数。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">双十一改变中国</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">无论多么困难，多么地有戏剧性，它确实做到了，双十一改变了中国的方方面面，我们不妨简单盘点下有哪些领域受到影响。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">互联网</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">首先是互联网的基础设施建设。如果你是网购老司机，早早就加入双十一剁手大军，那你一定对前几年的惨痛经历记忆犹新。当时，瞬间涌入的海量流量一下子就把淘宝的网站冲垮了，不仅页面无法打开、在线支付也遭遇到严重拥堵。后果很直接，一秒钟的故障发生在关键时刻，很可能就意味着千万级的损失。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">不过，有需求，就有往前走的动力。如今，“土豆服务器”进了历史书，取而代之的是一连串惊人的数据：2018年双十一期间，阿里云上新增调用的弹性计算能力累计超过1000万核，相当于10座大型数据中心，创造了“脉冲计算”的新纪录。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">同时，除了天猫、淘宝之外，阿里云还服务了中国邮政、茅台等众多客户，为物流、支付、新零售等各行业提供强有力的计算服务。从线上到线下，从生产制造到物流配送，从国内到海外，也多亏双十一的磨练，让阿里云的计算能力延伸到各行各业，极大地降低了社会的计算成本。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">物流</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">然后是物流。随着交易额的不断攀升，2018年天猫双十一的物流订单也在飞速增长，16小时48分钟，2018年天猫双十一物流订单达8.12亿，超过2017年双十一全天订单量，相当于十年前天猫双十一全天物流订单量的3100余倍。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/1316391_image3.png\" alt=\"2bM5TRYYkytccXeb78LDqZ0Od9qopbcL2voVsPXP.jpeg\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">快递爆仓的情景还历历在目，在今年，我狠心拍下的iPhone XS还要等到天荒地老才能拆包吗？</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">时过境迁，在超级机器人分拨中心里，机器人昼夜作业，每天可分拣超50万只包裹，据统计，一个分拨中心的机器人三天的行驶里程就足以绕地球一圈，这是十年前还很难想象的场景。那个时候，不管是分拨中心还是中转仓库，基本还是以手工操作为主，“暴力分拣”屡被诟病。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">毫无疑问，双十一的十年，中国快递物流行业完成了从拼人力、粗放经营，到数字化、智能化应用的转变。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">消费习惯</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">再者就是消费习惯。事实上，中国最早的电子商务网站可以追溯至1999年的8848网站，但这终究只是铺垫。网民基础薄弱，缺乏支付途径等，这些因素都注定让电商行业成功起飞。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">但现在不一样了，网购不在是年轻人的专利，智能手机普及后，大爷大妈都学会网购了。根据中国电子商务研究中心此前发布的《2018年（上）中国网络零售市场数据监测报告》，2018年上半年国内网络零售市场交易规模达40810亿元，同比增长30.1%。中国社会消费品零售总额180018亿元，同比增长9.4%。 也就是说，上半年国内网络零售市场交易规模已占据社会消费品零售总额的22.7%。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">当外国人还习惯到沃尔玛购物的时候，中国的网购大妈已经领先全球。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">区块链上车了</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">除此之外，包括移动支付在内，还有无数行业因为双十一的诞生、发展，坐上了快速列车。在今年，更有一个新乘客格外引人注目，它就是区块链。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">蚂蚁区块链技术首次全面参与了今年的“天猫双十一”活动。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">其中，天猫和比利时安特卫普钻石交易所正式达成合作，双十一期间“比利时钻石馆”里的每一颗钻石都会附上唯一的区块链“身份证”，用支付宝、天猫、淘宝扫一扫，就能看到它从海外采购到国内配送等重要环节的全链路信息。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/1316396_image3.png\" alt=\"WYUZHMCKtIVcDdLGadSwvFg7wkCNsVH5AdG7pDaA.jpeg\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">不只是昂贵的钻石，蚂蚁区块链商品溯源技术还应用到了另一些商品中，如广泛进口的国外奶粉、美妆、保健品，中国的茅台等高端酒、以及五常大米、平武蜂蜜等地方特产。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">有别于商家自主录入商品信息，天猫平台建立的这套智能追溯体系，通过蚂蚁区块链技术将钻石商品溯源系统数据以联盟链形式上链，实现数据的透明、不可篡改、充分共享等功能。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">其实早在今年1月，区块链就在支付宝中得以应用。蚂蚁金服则是在2016年就接入蚂蚁区块链了。这表明，阿里巴巴在区块链出现早期就已开始了布局。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">目前，蚂蚁区块链技术有许多场景已经落地。根据官方公布的资料显示，截至目前，蚂蚁金服区块链技术已经进入公益溯源、商品溯源、城市服务、跨境支付、司法维权和供应链金融等六大领域。例如，在浙江上线全国首个区块链医疗电子票据、和海南省政府合作推出全国首个区块链公积金存证、和杭州互联网法院共同上线全球首个司法链、在香港和菲律宾推出全球首个区块链跨境汇款等。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\">INE——全新的共享网络时代</strong></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">不难看出，近年来，区块链技术以其开放性、透明性、不可篡改、匿名性和去中心化等特点被业界广泛关注，个中不乏具有前瞻性的技术项目，INE智联生态是其中之一。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">IntelliShare（INE）由深圳、硅谷、上海三支团队组成，由旅美18年、早期在硅谷从事数据处理与研究的熊羽睿领军，多个国内外技术人员参与，顾问方面则由从事互联网近20年工作后，与万向区块链实验室的肖风博士一起捐助了早期以太坊中国社区的符德坤先生、原上海浦东软件园总工程师Eric Zhu博士、纽约州立大学布法罗分校的ThinkLab区块链实验室负责人的Bina Ramamurthy博士领衔，阵容堪称豪华。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/891007_image3.png\" alt=\"tUrcYLtyI1s5IcRrI4qVhMkVI0o7wryR9ABCF9SD.jpeg\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">IBM预测2020年万物互联的设备将超过250亿个，将有巨大的通讯需求，依靠传统网络技术传输数据会产生极其高昂的网络运营成本。为此，INE构建了一个具有分布式传输功能，能够优化Lora、NB-lot的INE Mesh网络，不仅能保障数据的安全，还让物联网企业避免耗巨资建设自己的专网，节约物联网企业80%的成本。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">广阔的应用场景</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">在未来，INE可保证多种智能设备方便快捷地完成点对点数据低成本传输，为互联网领域的多种应用场景提供数据传输底层网络环境。 既然谈到双十一，我们可以假设一个这样的场景，11月10日23时59分，当你聚精会神，正准备秒杀降价商品时，画面却突然静止，只剩下屏幕中央的不断旋转的图标——网络拥堵又一次让你与神价格擦肩而过。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">传统移动运营商采取的NB-IoT、LTE中心化模式，让所有信号都通过基站传导到中心的服务器集群，但当使用量大时，就很容易出现网络拥堵的问题。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">而IntelliShare Mesh通过其特有的网池技术突破设备数量的限制，即相互连接的节点不随着其数量的快速增加而产生相应的拥堵问题，随时保持网络通畅与多跳特性。日后，随着INE项目的应用场景的落地，越来越多人将真正享受到双十一秒杀的乐趣。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/1316397_image3.png\" alt=\"prraesmVzSQeuBrjRrdg5Iu5nIlAvyNFwOALBoJK.jpeg\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">另外，也许你无法想象，目前，世界仍然有很多地区比较贫穷落后，大约有40亿人口从未接入互联网。由于财力不足和地理位置过偏、人口密度过于稀疏等问题，不可能在这些地区进行大量的电信基础建设，那里的人们完全处于“无网”的状态。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">相对于造价高昂的传统通讯模式，IntelliShare依靠区块链+Mesh网络的技术特点，只需要低廉的成本既可以让用户在无网环境下相互通讯，也可以通过节点跳跃进入广域互联网与世界同步。不久之后的某一天，那些住在地球另一端的人们很可能会受惠于INE，成为网购消费者的员，从此，天涯还是海角，想购就购。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-size: unset; line-height: 30px; margin-bottom: 30px;\"><br/></strong></p><p><br/></p><br/>', '双十一改变中国 区块链改变未来', 'http://crawl.nosdn.127.net/992534f6714a1cf96fbc03ab2811e8f1.jpg', '1', '11636');
INSERT INTO `t_notice` VALUES ('30204', '2018-11-13 03:29:00', '<p><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 亲爱的共享矿场家人们，为了更好地为您服务，提醒您在转账时务必认真审核项目方收币地址，并上传真实的转账截图凭证。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近期公司将在您的专属矿机上贴上您的名字，提醒您记得在APP内修改您的昵称哦！感谢您一直以来对我们的支持与陪伴，谢谢！<br/>&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 共享矿场市场运营部</p>', '会员手册', '', '2', '2715');
INSERT INTO `t_notice` VALUES ('30205', '2018-11-13 03:31:00', '<p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">如果将区块链技术运用在现实生活中，我们的生活将会被大大改变。类似于互联网商用化以后，带来的变化。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">从前，信息都是中央集中管理，但是在区块链的世界中信息是复制保存在许多电脑中的。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">每个人都能接收并且传送信息，任何人都可以查到，所以账本的交易内容都是透明的。因为有多人检查信息，所以透明性和安全性都很高。区块链如果运用到我们的生活当中，我们将更加便利。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">假设有一个人每天早上7点都会去咖啡店买一杯咖啡，这是需要本人亲自去买的。但是如果在运用区块链技术，就可以记录下每个人的要求，结合IoT与AI，每天把咖啡配送到家中。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">饭店使用的肉·菜·海鲜的生产地，一般都是会贴在店里的墙上，但是这些的真实性我们是没有办法进行确认的。我们只能相信老板的一面之词。但是有了区块链技术就不一样了，我们可以随时通过手机查询信息。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">离职时总是要与前公司申请经历证明，这是很麻烦的。但是如果有区块链技术的话只要同意提供信息，你的信息马上就可以被新的公司查询。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">“区块链技术就是以记录·传达·信任形成的，传达是P2P，效率是人工智能，连接是loT。各种的ICBM技术相结合，将出现一个新的世界。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">相关人士说到“个人对个人的交易，可以提高信任度，但是这一技术我们只是弄懂了它的原理，并没有完美的实现”“区块链技术可以提高数据流量的透明度，但是只需技术相关人员就可以轻易的控制它”</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">所以也有人，对区块链抱有警戒的心理。区块链是要颠覆我们信任已久的东西，让我们信任其他技术与系统。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">而且如果导入区块链技术的话，我们可能会失去“忘记”的权利。有些想永远忘记的事情，可能会通过区块链技术，永久留存下来。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: center; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><img src=\"https://img.jinse.com/1277413_image3.png\" alt=\"区块链技术将如何改变世界\"/></p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"></p><p><br/></p>', '区块链技术将如何改变世界', 'http://img.sccnn.com/bimg/341/03454.jpg', '1', '5158');
INSERT INTO `t_notice` VALUES ('30206', '2018-11-13 03:32:00', '<p>尊敬的用户您好！为响应国家互联网全面实名制的号召，从即日起，“共享矿场”平台的所有用户均需完成用户实名验证，否则无法正常使用矿机产品和imToken钱包提现功能！</p><p>（最终解释权归共享矿场平台所有）</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;共享矿场运营中心 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2018年11月16日官宣</p><p><br/></p>', '关于平台账号实名制的公告', '', '2', '2544');
INSERT INTO `t_notice` VALUES ('30207', '2018-11-15 16:33:00', '<p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">区块链在实体行业中的应用一直难以落地，原因众多，对几十家区块链创业团队进行采访之后，发现了以下三点主要原因：</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">1.&nbsp;技术门槛高</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">不仅区块链对大众理解的门槛太高，同时水平参差不齐的开发者们所编写的智能合约总有这样或者那样的漏洞，严重影响用户体验。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">2.&nbsp;隔行如隔山</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">每个行业都有各自的运行规则与生产逻辑，无视现实的理想化设计在理论上看似美好，但终究都招架不住现实的考验。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">3.&nbsp;体系不完备</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">在互联网时代，发现市场的痛点并不难，可是想要客观解析痛点，还必须要在行业中经历大量的实践并且不断反思才行。而在区块链产业需要的市场体系还不完备的情况下，要从具体的场景应用上解决问题，往往超出了单一项目和团队的能力。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">显然，一个区块链项目想要落地，只懂区块链技术是远远不够的，还要清楚产业逻辑，要懂得行业规则，更得有深度的调研积累，能够深刻分析市场痛点。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">这不仅对开发者提出了超高的要求，并且需要大量的时间成本和资源成本的支持。这很像是一场越野马拉松，要翻的山、要过的坑实在是太多了，要到达终点，开发者必须要能沉住气，一步一个脚印的前行。但现实是开发者往往既没有人力，又没有时间，更没有资源，大家能做的只能是冲刺。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">于是大量的开发者将自己累死在了赛道的开始阶段，好一些的摔死在了半路的暗坑中，只有极个别幸运的，猝死在了离终点两公里的地方。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">这说明，区块链产业的发展不但需要项目开发者的逐渐成熟，也需要第三方服务的逐步支持。正如做电商不仅需要开网店，更需要支付宝、物流体系等业务的落地和支撑。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">区块链创业项目的繁荣与第三方服务体系的繁荣相辅相成。当前，区块链业界已经涌现出了专业法律服务、上链上币服务、智能合约服务、社群运营服务、媒体推广服务、技术测评服务等众多第三方服务内容，但他们和区块链项目方一样，依然面临着标准化、规范化的问题，和公信力、专业性的考验。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">充分认识到了第三方服务体系的重要作用，我们将用自己的力量，为项目方提供诉求发布的视频形态和媒体平台，为第三方服务对接市场资源和客户需求，为区块链信息的价值呈现，探索业内与业外交互融合的服务模式，实现存量市场和增量用户间的有效协同。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">将通过视频表达诉求的发布和对接，推动高价值信息上链经营，推动 “区块链+” 项目以智能合约的形态达成合作。</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin: 32px 0px; padding: 0px; font-size: 18px; line-height: 36px; word-wrap: break-word; word-break: normal; color: rgb(41, 41, 59); text-align: justify; font-family: &#39;PingFang SC&#39;, &#39;Lantinghei SC&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, &#39;Microsoft YaHei&#39;, &#39;\\\\微软雅黑&#39;, STHeitiSC-Light, simsun, &#39;\\\\宋体&#39;, &#39;WenQuanYi Zen Hei&#39;, &#39;WenQuanYi Micro Hei&#39;, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">欢迎更多想要抓住区块链风口，实现 “区块链+” 转型的传统企业与我们联系，共同探索 “区块链+” 的策略和方案，并在《共享矿场》上进行信息对接与价值整合，共同实现业务的区块链化，让更直观的第三方信息服务体系为区块链项目的经营插上翅膀</p><p><br/></p>', '区块链的发展不能只看链与币更需要繁荣的第三方服务体系', 'http://wx3.sinaimg.cn/crop.0.0.889.499.1000/006W9mQogy1fo5qizqj2qj30p00dwaum.jpg', '1', '6195');
